  false,\n\t\"url\": null,\n\t\"notes\": \"Statewide lake watershed delineations for
  all lakes that have a surface area of 100 acres in size or larger. Data includes
  major watershed identifiers and USGS hydrologic unit codes (HUC). The data also
  includes the outlet positions of each lake watershed as points. This data was created
  from hydrologically corrected digital elevation models (ANUDEM) in concert with
  on-screen delineation in ArcView.\",\n\t\"license_title\": null,\n\t\"extras\":
